import { Canvas } from "@react-three/fiber";
import { OrbitControls } from "@react-three/drei";


export default function Plane() {
   return (
      <Canvas>
        <OrbitControls enableZoom={true} />
         <ambientLight />
         <mesh>
         <planeBufferGeometry attach="geometry" args={[10, 10]} />
   <meshBasicMaterial
    attach="material"
    color="black"
    opacity={0.5}
    transparent
   />

         </mesh>


         <mesh>
         <planeBufferGeometry attach="geometry" args={[10, 10]} />
   <meshBasicMaterial
    attach="material"
    color="red"
    opacity={0.5}
    transparent
   />

         </mesh>
      </Canvas>
   );
}
